import React from "react";
import "./styles.css";
import ReactSimpleCarousel from "react-spring-carousel";
import Image1 from "./images/test.png";
import Image2 from "./images/test.png";
import Image3 from "./images/test.png";

const slides = [
  {
    image: Image1,
    text: "Exercitation tempor",
  },
  {
    image: Image2,
    text: "dolore proident id",
  },
  {
    image: Image3,
    text: "proident id irure",
  },
];
function Carousel() {
  return (
    <div className="App">
      <ReactSimpleCarousel slidesToShow={5}>
        {slides.map(({ image, text }, i) => (
          <div key={i} className="App-slide">
            <a href={`#${i}`} draggable="false">
              <img src={image} alt="" />
            </a>
            <p
              style={{
                position: "absolute",
                top: "50%",
                left: "50%",
                transform: "translateX(-50%) translateY(-50%)",
              }}
            >
              {text}
            </p>
          </div>
        ))}
      </ReactSimpleCarousel>
    </div>
  );
}
export default Carousel;
